import Layout from "../components/Layout";
import Feed from "../components/feed";

import { Grid } from "@material-ui/core";

const Index = () => (
  <Layout>
    <Grid container>
      <Grid item></Grid>
      <Feed />
    </Grid>
  </Layout>
);

export default Index;
